import React from 'react';

const DynamicImage = (props) => {
  const altText = props.alt || "dynamic image";
  const mystyle = {
    width: "250px",
    padding: "10px"
  };
  return (
    <img src={require('../images/' + props.src )} alt={altText} style={mystyle}/>
  );
};

export default DynamicImage;
